import { BrowserRouter as Switch, Routes, Route, Link } from "react-router-dom";
import Home from "./Pages/Home";

function App() {
  return (
    <Routes>
      <Switch>
        <Route path="/" element={<App />} />
        <Route path="*" element={<Whoops404 />} />
      </Switch>
    </Routes>
  );
}

export default App;
